import React from "react";

function Contact() {
  return (
    <section id="contact" className="py-20 container mx-auto px-6">
      <h2 className="text-3xl font-bold text-center mb-10">Contact Me</h2>
      <form className="max-w-xl mx-auto bg-white shadow-md rounded-xl p-8 space-y-4">
        <input type="text" placeholder="Your Name" className="w-full p-3 border rounded-lg" />
        <input type="email" placeholder="Your Email" className="w-full p-3 border rounded-lg" />
        <textarea placeholder="Your Message" className="w-full p-3 border rounded-lg h-32"></textarea>
        <button className="bg-blue-600 text-white px-6 py-3 rounded-lg font-semibold hover:bg-blue-700 transition">
          Send Message
        </button>
      </form>
    </section>
  );
}

export default Contact;
